            <div className='textUpdate'>
            <p className='riad'>উচ্চ তাপমাত্রা বছরে ঢাকার ক্ষতি প্রায় ৬০০ কোটি ডলার </p>
            
           
            

            </div>

        </div>
    );
};

export default News;
